package com.kurgan.kursach.models;import lombok.*;import javax.persistence.*;import java.io.UnsupportedEncodingException;import java.util.Base64;import java.util.Set;@Entity@Table(name = "parking")@Setter@Getter@ToString@AllArgsConstructor@NoArgsConstructorpublic class Parking {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long parking_id;    private String address;    private int places;    @OneToMany    @JoinTable(name = "car_parking", joinColumns = @JoinColumn(name = "parking_id", referencedColumnName = "parking_id"),            inverseJoinColumns = @JoinColumn(name = "car_id", referencedColumnName = "car_id"))    private Set<Car> cars;}